class Solution {
public:
    vector<int> factors(int n){
        vector<int>ans;
        for(int i = 1;i<=n ;i++){
            if(n%i == 0)ans.push_back(i);
        }

        return ans;
    }
    int kthFactor(int n, int k) {
        vector<int>arr = factors(n);
        if(k>arr.size())return -1;
        return arr[k-1];
    }
};
